 收款单据类型 缺省DTO 
 OnInserting()
{
   /*校验一个组织下只能有一个默认类型*/
   if(this.IsDefault == true)
   {
        Org theOrg = this.Org;
        EntitySet typeSet = ReceivableBillType.Finder.find(
		"Org=theOrg and isDefault=true");
	if(typeSet != null and typeSet.length>0)
 	    throw new Exception("一个组织下只能有一个默认类型");
   }
}
